[¬s]"The intervention is based on physical training in incremental steps, with repeated practice, aim-
ing to improve focussed attention and executive function, and has a number of elements as
follows:
• Visual attention and eye tracking skills;
• Classroom mild aerobic exercise;
• Concentrating attention on limb-movement patterns;
• Cross-lateral body coordination;
• Relaxation."
"A few examples of how pupils’ attention is focussed are as follows. Their awareness is drawn to
physical sensations in hands, arms and feet by rubbing or tapping the area before physically mov-
ing a limb.[¬e]"

